import axios from 'axios'

export const getBreeds = () => {
    axios('https://frontend-take-home-service.fetch.com/dogs/breeds', {
        method: 'GET',
        withCredentials: true,
    })
        .then((res) => {
            console.log(res);
        })
        .catch((err) => {
            console.log(err.response);
        });
};


export const registerSite = async ({Name, Email}: {Name: String, Email: String}) => {
    const response  = axios.post('https://frontend-take-home-service.fetch.com/auth/login', {
        name: Name,
        email: Email
        
      })
      .then(function (response) {
        console.log(response.headers)
      })
      .catch(function (error) {
        console.log(error);
      });

    console.log(response)
};
